import style from "./Navbar.module.css";
import { AiFillHome } from "react-icons/ai";
import { FaRegCalendarAlt } from "react-icons/fa";
import { AiOutlineBarChart } from "react-icons/ai";
import { FaSearch } from "react-icons/fa";
import { AiFillSetting } from "react-icons/ai";
import { MdAccountCircle } from "react-icons/md";

const SIDEBAR__ICON = [
  ["home", <AiFillHome className={style["sidebar__icon"]} data-id={0} />],
  [
    "calendar",
    <FaRegCalendarAlt className={style["sidebar__icon"]} data-id={1} />,
  ],
  [
    "chart",
    <AiOutlineBarChart className={style["sidebar__icon"]} data-id={2} />,
  ],
  <FaSearch className={style["sidebar__icon"]} data-id={3} />,
  <MdAccountCircle className={style["sidebar__icon"]} date-id={5} />,
  <AiFillSetting className={style["sidebar__icon"]} data-id={4} />,
];

function Navbar(props) {
  function test() {
    props.setPage(3);
    props.showNavBar();
  }

  return (
    <div
      className={`${style.navbar} ${
        props.showNavBar && `${style["navbar--show"]}`
      }`}
    >
      <button onClick={test}>test</button>
      <div> </div>
      <div> </div>
    </div>
  );
}

export default Navbar;
